import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Outline from './outline.png';
import Typed from 'react-typed';


function Home() {

    return(
        <React.Fragment>
            <Container>
                <Row>
                    <Col className="homeText">
                        <h1>Hello!</h1>
                        <h2>My name is Rohan Bawa. I am a </h2>
                         <Typed strings={['computer science major.', 'bollywood fusion dancer.', 'sports enthusiast.']}
                             typeSpeed={35}
                             backSpeed={15}
                        />
                    </Col>
                    <Col>
                        <img src={Outline} alt='outline'/>
                    </Col>
                </Row>
            </Container>
        </React.Fragment>
    );

}

export default Home;
